    public final int getMaxNameLength() { return MAX_NAME_LENGTH; }

    public final static int
           NUM_STATES        = 511,
           NT_OFFSET         = 124,
           LA_STATE_OFFSET   = 5673,
           MAX_LA            = 2147483647,
           NUM_RULES         = 526,
           NUM_NONTERMINALS  = 200,
           NUM_SYMBOLS       = 324,
           SEGMENT_SIZE      = 8192,
           START_STATE       = 2379,
           IDENTIFIER_SYMBOL = 0,
           EOFT_SYMBOL       = 119,
           EOLT_SYMBOL       = 119,
           ACCEPT_ACTION     = 4908,
           ERROR_ACTION      = 5147;

